import React, { Component } from 'react';
import { useFormik } from 'formik';

const SignupForm = () => {
  const event_info = useFormik({
    initialValues: {
      event_name: '',
      location: '',
      creator: '',
    },
    onSubmit: values => {
      alert(JSON.stringify(values, null, 2));
    },
  });
  return (
    <form onSubmit={event_info.handleSubmit}>
      <label>Event Name</label>
      <input
        id="event_name"
        name="event_name"
        type="event_name"
        className="form-control"
        onChange={event_info.handleChange}
        value={event_info.values.event_name}
      />
      <button type="submit">Submit</button>

      <label>Location</label>
      <input
        id="location"
        name="location"
        type="location"
        className="form-control"
        onChange={event_info.handleChange}
        value={event_info.values.location}
      />
      <button type="submit">Submit</button>

      <label>Creator</label>
      <input
        id="creator"
        name="creator"
        type="creator"
        className="form-control"
        onChange={event_info.handleChange}
        value={event_info.values.creator}
      />
      <button type="submit">Submit</button>

    </form>
  );
};


class Splash extends Component {
	render() {
		return(
			<div  className="App"> <SignupForm /> </div>
		)
	}
}

export default Splash
